import React, { Component } from 'react'
import fac from '../components/facebook.png'
import yout from '../components/youtube.png'
import inst from '../components/instagram.png'
import img1 from "./img1.jpg"

class Users extends Component {
  render() {
    return (
      <div className='card'>
        <img className='card-img-top rounded-circle' src={img1} alt=''/>
        <div className='card-body'>
          <h5 className='card-title'>Web Developper</h5>

        </div>
      </div>
    )
  }
}




export default Users;
